import React, { Component } from 'react';
import './component/css/App.css';
import './component/css/Top_header.css';
import './component/css/Header.css';
import './component/css/Footer.css';
import Header from './Header';
import Top_header from './Top_header';
import Footer from './Footer';

import {

  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect

} from "react-router-dom";

//page

// import MainPage from "./pages";
import NotFoundPage from "./pages/404";
import Home from "./pages/Home";
import Register from "./pages/Register_page";
import SignIn from "./pages/SignIn_page";
import Gigs from "./pages/Gigs_page";
import Photos from "./pages/Photos_page";
import About from "./pages/About_page";




class App extends Component {
  render() {
    return (


    <Router> 

  <Top_header />
  <Header />
  <Footer />



  <Switch>

 <Router exact path ="/404" component={NotFoundPage} />
 <Router exact path ="/Home" component={Home} />
 <Router exact path ="/Register_page" component={Register} />
 <Router exact path ="/SignIn_page" component={SignIn} />
 <Router exact path ="/Gigs_page" component={Gigs} />
 <Router exact path ="/Photos_page" component={Photos} />
 <Router exact path ="/About_page" component={About} />

 <Redirect to ="/404" />

  </Switch>



   </Router> 




);
  }
}
export default App;
